import React from "react"
import { useRoutes } from "react-router-dom";
import LogoOnlyLayout from "./layout/LogoOnlyLayout";
use
export default function Router() {
    return useRoutes([
        {
            path: "/",
            element: <LogoOnlyLayout />,
            children: [
                {
                    path: "login",
                    element: <Login />,
                },
                {
                    path: "register",
                    element: <Register />,
                },
            ],

        },
    ]);
}
